from aiogram.types import InlineKeyboardButton, InlineKeyboardMarkupfrom data.search_questions import IslomUzfrom typing import Listdef set_question_key(topic_name: str, search_results: List[IslomUz.SearchResults]):    answer_keyboard_list = [[], []]    i = 0    for result in search_results:        j = i // 5        answer_keyboard_list[j].append(            InlineKeyboardButton(                text=f"{i + 1}",                callback_data=f"{topic_name}:{result.answer_url}"            )        )        i += 1    return InlineKeyboardMarkup(inline_keyboard=answer_keyboard_list)